INSERT INTO `oxpayments` VALUES ('oxidpaypal', 1, 'PayPal', 0, 'abs', 0, 0, 0, 10000, '', 0, 'PayPal', '', '', '', '', '', '<div>Bei Auswahl der Zahlungsart PayPal werden Sie im nächsten Schritt zu PayPal weitergeleitet. Dort können Sie sich in Ihr PayPal-Konto einloggen oder ein neues PayPal-Konto eröffnen und die Zahlung autorisieren. Sobald Sie Ihre Daten für die Zahlung bestätigt haben, werden Sie automatisch wieder zurück in den Shop geleitet, um die Bestellung abzuschließen.</div> <div style="margin-top: 5px">Erst dann wird die Zahlung ausgeführt.</div>', '<div>When selecting this payment method you are being redirected to PayPal where you can login into your account or open a new account. In PayPal you are able to authorize the payment. As soon you have authorized the payment, you are again redirected to our shop where you can confirm your order.</div> <div style="margin-top: 5px">Only after confirming the order, transfer of money takes place.</div>', '', '', 0, '2018-04-30 13:52:37', NULL, 'PayPal', 1, 1, 'https://exmaple.com/img.img', 'https://exmaple.com/img.img', 'https://exmaple.com/img.img', 'https://exmaple.com/img.img', 'other', 0);

